import React from 'react'

export default function About() {
    return(
        <div>
            <h3>
                We are small team of people aspire to provide platform for people "axcess" 
                <br />
                the book review of their favorites book
                if it's not on the list, one can simple add their own favorite book to review and other people to enjoy!
            </h3>
        </div>
    )
}
